-- ----------------------------
-- Table structure for traffic_sources
-- ----------------------------
DROP TABLE IF EXISTS `traffic_sources`;
CREATE TABLE `traffic_sources`  (
  `id` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `createdAt` datetime(3) NOT NULL DEFAULT current_timestamp(3),
  `updatedAt` datetime(3) NOT NULL,
  `name` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `value` double NOT NULL DEFAULT 0,
  `totalKeywords` int NOT NULL DEFAULT 0,
  `totalEstimatedTraffic` double NOT NULL DEFAULT 0,
  `organicEstimatedTraffic` double NOT NULL DEFAULT 0,
  `averageRank` double NULL DEFAULT NULL,
  `rankSampleSize` int NOT NULL DEFAULT 0,
  `clientId` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `traffic_sources_clientId_name_key`(`clientId` ASC, `name` ASC) USING BTREE,
  INDEX `traffic_sources_clientId_idx`(`clientId` ASC) USING BTREE,
  CONSTRAINT `traffic_sources_clientId_fkey` FOREIGN KEY (`clientId`) REFERENCES `clients` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = DYNAMIC;

